import React from 'react';
import { Album } from '../../Album';

const Albuns = (props: any) => {
  //   console.log(`Aqui Albuns: ${props.onFilteredTerm()}`);
  const filteredAlbuns = props.items.filter((album: any) => {
    return album.artist === props.onFilteredTerm();
  });

  console.log(filteredAlbuns);
  return (
    <div>
      {filteredAlbuns.map((album: Array<Album>) => {
        return { album };
      })}
    </div>
  );
};

export default Albuns;
